INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("2024/12/22 12:00:00", 119901, 0, 0, 14, 0, 0, 0, 302, 119901, 1, 1, 1, 2.17, 0, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 119901, 3, "ミヤコ（クリスマス）", 1, 0, 450, "みやこ", 119901, "2024/12/31 11:59:59");
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("2025/03/10 12:00:00", 120001, 0, 0, 6, 0, 0, 0, 190, 120001, 5, 1, 1, 2.375, 0, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 120001, 3, "シズル（ノワール）", 5, 0, 450, "しずる", 120001, "2025/03/15 14:59:59");
